import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Layout from '../components/Layout';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap

function Search() {
  const [searchTerm, setSearchTerm] = useState('');
  const [movies, setMovies] = useState([
    // ... Your movie data remains the same ...
  ]);

  const [filteredMovies, setFilteredMovies] = useState(movies);
  const [selectedGenre, setSelectedGenre] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    if (selectedGenre) {
      document.title = `${selectedGenre} movies`;
    } else if (searchTerm) {
      document.title = `Search results for "${searchTerm}"`;
    } else {
      document.title = 'Search Movies';
    }
  }, [selectedGenre, searchTerm]);

  const handleSearch = (e) => {
    e.preventDefault();
    setSelectedGenre('');
    const results = movies.filter(movie =>
      movie.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
      movie.director.toLowerCase().includes(searchTerm.toLowerCase()) ||
      movie.year.toString().includes(searchTerm)
    );
    setFilteredMovies(results);
  };

  const handleGenreClick = (genre) => {
    setSearchTerm('');
    setSelectedGenre(genre);
    const results = movies.filter(movie => movie.genre === genre);
    setFilteredMovies(results);
  };

  const redirectToMovieInfo = (id) => {
    navigate(`/movie/${id}`);
  };

  return (
    <Layout>
      <div className="container mt-5">
        <h1 className="text-center mb-4" style={styles.heading}>
          {selectedGenre ? `${selectedGenre} movies` : searchTerm ? `Search results for "${searchTerm}"` : 'Search Movies'}
        </h1>

        {/* Search Form */}
        <form onSubmit={handleSearch} className="d-flex justify-content-center mb-4">
          <input
            type="text"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            placeholder="Search by title, director, or year..."
            className="form-control me-2"
            style={{ maxWidth: '300px' }}
          />
          <button type="submit" className="btn btn-gold">Search</button>
        </form>

        {/* Movie Cards */}
        <div className="row">
          {filteredMovies.length > 0 ? (
            filteredMovies.map(movie => (
              <div key={movie.id} className="col-sm-6 col-md-4 col-lg-3 mb-4">
                <div className="card" style={styles.card}>
                  <img src={movie.poster} alt={movie.title} className="card-img-top" style={styles.poster} />
                  <div className="card-body" style={styles.cardBody}>
                    <h6 className="card-title" style={styles.cardText}>{movie.title}</h6>
                    <p className="card-text" style={styles.cardText}><small><strong>Director:</strong> {movie.director}</small></p>
                    <p className="card-text" style={styles.cardText}><small><strong>Year:</strong> {movie.year}</small></p>
                    <button
                      onClick={() => handleGenreClick(movie.genre)}
                      className="btn btn-outline-gold btn-sm mb-2"
                      style={styles.genreButton}
                    >
                      {movie.genre}
                    </button>
                    <button
                      onClick={() => redirectToMovieInfo(movie.id)}
                      className="btn btn-gold btn-sm"
                      style={styles.viewButton}
                    >
                      View Details
                    </button>
                  </div>
                </div>
              </div>
            ))
          ) : (
            <p className="text-center">No movies found.</p>
          )}
        </div>
      </div>
    </Layout>
  );
}

// IMDb-inspired styles
const styles = {
  heading: {
    color: '#FFD700',  // Gold heading
  },
  card: {
    backgroundColor: '#2c2c2c',  // Dark background
    color: '#FFF',  // White text for readability
    maxWidth: '180px',
    margin: '0 auto',
    border: '1px solid #FFD700',  // Gold border for IMDb style
  },
  poster: {
    height: '250px',
    objectFit: 'cover',
  },
  cardBody: {
    padding: '10px',
  },
  cardText: {
    color: '#FFF',  // White text inside card
  },
  genreButton: {
    color: '#FFD700',  // Gold text
    borderColor: '#FFD700',  // Gold border
  },
  viewButton: {
    backgroundColor: '#FFD700',  // Gold background
    color: '#000',  // Dark text for contrast
    border: 'none',
  },
};

export default Search;
